import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import React from 'react';

import "antd/dist/antd.css";
import LogoTiki from "../../khachhang/logoTiki.png";
import "./style.css";


import { Layout, Menu } from 'antd';
import {
    MenuUnfoldOutlined,
    MenuFoldOutlined,
    UserOutlined,
    UploadOutlined,
    GiftOutlined,
    ContainerOutlined,
    HomeOutlined,
    BarChartOutlined
} from '@ant-design/icons';

import DsKhachHang from "./dsKhachHang";
import DsNhaBan from "./dsNhaBan";

const { Header, Sider, Content, Footer } = Layout;

export default class Navbar extends React.Component {
  state = {
    collapsed: false,
  };

  toggle = () => {
    this.setState({
      collapsed: !this.state.collapsed,
    });
  };

  render() {
    return (
        <Router>
            <Layout>
                <Sider trigger={null} collapsible collapsed={this.state.collapsed}>
                <div className="logo">
                    <img src={LogoTiki} alt="logo tiki" width="45%"/>
                </div>
                <Menu theme="dark" mode="inline" defaultSelectedKeys={['1']} >
                    <Menu.Item key="1" icon={<HomeOutlined/>} >
                        <Link to="/dskhachhang">Trang chủ</Link>
                    </Menu.Item>
                    <Menu.Item key="2" icon={<GiftOutlined/>}>
                        <Link to="/dskhachhang">Danh sách sản phẩm</Link>
                    </Menu.Item>
                    <Menu.Item key="3" icon={<ContainerOutlined />}>
                        <Link to="/dskhachhang">Danh sách hóa đơn</Link>
                    </Menu.Item>
                    <Menu.Item key="4" icon={<BarChartOutlined />}>
                        <Link to="/dskhachhang">Doanh Thu</Link>
                    </Menu.Item>
                    <Menu.Item key="5" icon={<UserOutlined />}>
                        <Link to="/dskhachhang">Thông tin nhà bán</Link>
                    </Menu.Item>
                </Menu>
                </Sider>
                <Layout className="site-layout">
                <Header className="site-layout-background" style={{ padding: 0 }}>
                    {React.createElement(this.state.collapsed ? MenuUnfoldOutlined : MenuFoldOutlined, {
                    className: 'trigger',
                    onClick: this.toggle,
                    })}
                </Header>
                <Content
                    className="site-layout-background"
                    style={{
                    margin: '24px 16px',
                    padding: 24,
                    minHeight: 500,
                    }}
                >
                    <div> </div>Content
                </Content>
                <Footer style={{ textAlign: 'center' }}>Ant Design ©2018 Created by Ant UED</Footer>
                </Layout>
            </Layout>
            <Switch>
            <Route exact path="/dskhachhang">
                <DsKhachHang />
            </Route>
            </Switch>
        </Router>
    );
  }
}
